    public enum CuBlasAPIVersion
    {
        V10,
        V11,
        V12,
    }

    partial class CuBlasAPI
    {
        #region Creation

        private static CuBlasAPI? CreateInternal(CuBlasAPIVersion version)
        {
            if (RuntimeInformation.IsOSPlatform(OSPlatform.Windows) &&
                version == CuBlasAPIVersion.V10)
            {
                return new CuBlasAPI_Windows_V10();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.Linux) &&
                version == CuBlasAPIVersion.V10)
            {
                return new CuBlasAPI_Linux_V10();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.OSX) &&
                version == CuBlasAPIVersion.V10)
            {
                return new CuBlasAPI_OSX_V10();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.Windows) &&
                version == CuBlasAPIVersion.V11)
            {
                return new CuBlasAPI_Windows_V11();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.Linux) &&
                version == CuBlasAPIVersion.V11)
            {
                return new CuBlasAPI_Linux_V11();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.OSX) &&
                version == CuBlasAPIVersion.V11)
            {
                return new CuBlasAPI_OSX_V11();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.Windows) &&
                version == CuBlasAPIVersion.V12)
            {
                return new CuBlasAPI_Windows_V12();
            }
            else if (RuntimeInformation.IsOSPlatform(OSPlatform.Linux) &&
                version == CuBlasAPIVersion.V12)
            {
                return new CuBlasAPI_Linux_V12();
            }
            return null;
        }

        #endregion

